    "table",
    "th",
    "tr",
    "td",
    "thead",
    "tbody",
    "tfood",
    "label",
    "fieldset",
    "legend",
    "img",
    "picture",
    "br",
    "p",
    "hr",
    "a",
  ],
  allowedAttributes: {
    a: ["href"],
    img: ["src", "alt"],
  },
};

